    - name: GitHub
      url: 'https://github.com/opstree'
    - name: Opensource
      url: 'https://opstree.github.io'
    - name: Documentation
      url: 'https://ot-container-kit.github.io/redis-operator/'
  icon:
    - base64data: >-
        
      mediatype: image/svg+xml
  customresourcedefinitions:
    owned:
      - name: redis.redis.redis.opstreelabs.in
        displayName: Redis
        kind: Redis
        version: v1beta1
        description: Redis
        resources:
          - version: v1
            kind: Deployment
          - version: v1
            kind: Service
          - version: v1
            kind: ReplicaSet
          - version: v1
            kind: Pod
          - version: v1
            kind: Secret
          - version: v1
            kind: ConfigMap
        specDescriptors: []
        statusDescriptors: []
    required: []
  install:
    strategy: deployment
    spec:
      permissions: []
      clusterPermissions:
        - serviceAccountName: redis-operator
          rules:
          - apiGroups: 
              - '*'
            resources:
              - '*'
            verbs:
              - '*'
          - nonResourceURLs:
            - '*'
            verbs:
            - '*'
      deployments:
        - name: redis-operator
          spec:
            selector:
              matchLabels:
                control-plane: redis-operator
            replicas: 1
            template:
              metadata:
                labels:
                  control-plane: redis-operator
              spec:
                securityContext:
                  runAsUser: 65532
                containers:
                  - command:
                      - /manager
                    args:
                      - '--leader-elect'
                    image: 'quay.io/opstree/redis-operator:v0.5.0'
                    name: manager
                    securityContext:
                      allowPrivilegeEscalation: false
                    livenessProbe:
                      httpGet:
                        path: /healthz
                        port: 8081
                      initialDelaySeconds: 15
                      periodSeconds: 20
                    readinessProbe:
                      httpGet:
                        path: /readyz
                        port: 8081
                      initialDelaySeconds: 5
                      periodSeconds: 10
                    resources:
                      limits:
                        cpu: 100m
                        memory: 30Mi
                      requests:
                        cpu: 100m
                        memory: 20Mi
                terminationGracePeriodSeconds: 10
                serviceAccount: redis-operator
                serviceAccountName: redis-operator
  installModes:
    - type: OwnNamespace
      supported: true
    - type: SingleNamespace
      supported: true
    - type: MultiNamespace
      supported: true
    - type: AllNamespaces
      supported: true
